rt (NDR) and choose Send Again from the Report ribbon. In Outlook on the web, select this NDR, then select the link \"To send this message again, click here.\" Then delete and retype the entire recipient address. If prompted with an Auto-Complete List suggestion don\'t select it. After typing the complete address, click Send. Contact the recipient (by phone, for example) to check that the address exists and is correct. The recipient may have set up email forwarding to an incorrect address. Ask them to check that any forwarding they\'ve set up is working correctly. Clear the recipient Auto-Complete List in Outlook or Outlook on the web by following the steps in this article: Fix email delivery issues for error code 5.1.10 in Office 365, and then send the message again. Retype the entire recipient address before selecting Send. If the problem continues, forward this message to your email admin. If you\'re an email admin, refer to the More Info for Email Admins section below. Was this helpful? Send feedback to Microsoft. More Info for Email Admins Status code: 550 5.1.10 This error occurs because the sender sent a message to an email address hosted by Office 365 but the address is incorrect or doesn\'t exist at the destination domain. The error is reported by the recipient domain\'s email server, but most often it must be fixed by the person who sent the message. If the steps in the How to Fix It section above don\'t fix the problem, and you\'re the email admin for the recipient, try one or more of the following: The email address exists and is correct - Confirm that the recipient address exists, is correct, and is accepting messages. Synchronize your directories - If you have a hybrid environment and are using directory synchronization make sure the recipient\'s email address is synced correctly in both Office 365 and in your on-premises directory. Errant forwarding rule - Check for forwarding rules that aren\'t behaving as expected. Forwarding can be set up by an admin via mail flow rules or mailbox forwarding address settings, or by the recipient via the Inbox Rules feature. Recipient has a valid license - Make sure the recipient has an Office 365 license assigned to them. The recipient\'s email admin can use the Office 365 admin center to assign a license (Users > Active Users > select the recipient > Assigned License > Edit). Mail flow settings and MX records are not correct - Misconfigured mail flow or MX record settings can cause this error. Check your Office 365 mail flow settings to make sure your domain and any mail flow connectors are set up correctly. Also, work with your domain registrar to make sure the MX records for your domain are configured correctly. For more information and additional tips to fix this issue, see Fix email delivery issues for error code 5.1.10 in Office 365. Original Message Details Created Date: 6/9/2025 12:04:33 PM Sender Address: support@mahavirgroup.co Recipient Address: it.exe@benelli-india.com Subject: RE: Ticket ID: 146 - FOCUS -ERP issue Error Details Error: 550 5.1.10 RESOLVER.ADR.RecipientNotFound; Recipient it.exe@benelli-india.com not found by SMTP address lookup Message rejected by: PNZPR01MB4477.INDPRD01.PROD.OUTLOOK.COM Notification Details Sent by: PNZPR01MB4477.INDPRD01.PROD.OUTLOOK.COM Message Hops HOP TIME (UTC) FROM TO WITH RELAY TIME 1 6/9/2025 12:04:33 PM MAZPR01MB7958.INDPRD01.PROD.OUTLOOK.COM MAZPR01MB7958.INDPRD01.PROD.OUTLOOK.COM mapi * 2 6/9/2025 12:04:33 PM MAZPR01MB7958.INDPRD01.PROD.OUTLOOK.COM PNZPR01MB4477.INDPRD01.PROD.OUTLOOK.COM Microsoft SMTP Server (version=TLS1_2, cipher=TLS_ECDHE_RSA_WITH_AES_256_GCM_SHA384) * Original Message Headers Authentication-Results: dkim=none (message not signed)\r\n header.d=none;dmarc=none action=none header.from=mahavirgroup.co;\r\nReceived: from MAZPR01MB7958.INDPRD01.PROD.OUTLOOK.COM (2603:1096:a01:a1::6)\r\n by PNZPR01MB4477.INDPRD01.PROD.OUTLOOK.COM (2603:1096:c01:5::9) with\r\n Microsoft SMTP Server (version=TLS1_2,\r\n ci