n below. It\'s likely that only the recipient\'s email admin can fix this problem. Was this helpful? Send feedback to Microsoft. More Info for Email Admins Status code: 550 5.4.1 This error occurred because a message was sent to an email address hosted by Office 365, but the address doesn\'t exist in the receiving organization\'s Office 365 directory. Directory Based Edge Blocking (DBEB) is enabled for smartsign.com, and DBEB rejects messages addressed to recipients who don\'t exist in the receiving organization\'s Office 365 directory. This error is reported by the recipient domain\'s email server, but most often it can be fixed by the person who sent the message. If the steps in the How to Fix It section above don\'t fix the problem, and you\'re the email admin for the recipient, try one or more of the following: Check that the email address exists and is correct - Confirm that the recipient address exists in your Office 365 directory, is correct, and is accepting messages. Synchronize your directories - Make sure directory synchronization is working correctly, and that the recipient\'s email address exists in both Office 365 and in your on-premises directory. Check for errant forwarding rules - Check for forwarding rules for the original recipient that might be trying to forward the message to an invalid address. Forwarding can be set up by an admin via mail flow rules or mailbox forwarding address settings, or by the recipient via the Forwarding or Inbox Rules features. Make sure the recipient has a valid license - Make sure the recipient has an Office 365 license assigned to them. The recipient\'s email admin can use the Office 365 admin center to assign a license to them (Users > Active Users > Select the recipient > Assigned License > Edit). Make sure that mail flow settings and MX records are correct - Misconfigured mail flow or MX record settings can cause this error. Check your Office 365 mail flow settings to make sure your domain and any mail flow connectors are set up correctly. Also, work with your domain registrar to make sure the MX records for your domain are set up correctly. For more information and additional tips to fix this issue, see this article. Original Message Details Created Date: 6/13/2025 6:04:39 AM Sender Address: support@mahavirgroup.co Recipient Address: xyz@smartsign.com Subject: Ticket ID: 1973 - Whatsapp not coming Error Details Error: 550 5.4.1 Recipient address rejected: Access denied. For more information see https://aka.ms/EXOSmtpErrors [BL6PEPF0001AB4B.namprd04.prod.outlook.com 2025-06-13T06:04:43.679Z 08DDAA13CBD72F9F] Message rejected by: BL6PEPF0001AB4B.mail.protection.outlook.com Notification Details Sent by: PN2PR01MB8789.INDPRD01.PROD.OUTLOOK.COM Message Hops HOP TIME (UTC) FROM TO WITH RELAY TIME 1 6/13/2025 6:04:39 AM MAZPR01MB7958.INDPRD01.PROD.OUTLOOK.COM MAZPR01MB7958.INDPRD01.PROD.OUTLOOK.COM mapi * 2 6/13/2025 6:04:39 AM MAZPR01MB7958.INDPRD01.PROD.OUTLOOK.COM PN2PR01MB8789.INDPRD01.PROD.OUTLOOK.COM Microsoft SMTP Server (version=TLS1_2, cipher=TLS_ECDHE_RSA_WITH_AES_256_GCM_SHA384) * Original Message Headers ARC-Seal: i=1; a=rsa-sha256; s=arcselector10001; d=microsoft.com; cv=none;\r\n b=tgSN7KMmn8nYqzQHTGKFsKIdEGs+/+lKkuSngtDgnt5F3qZwWHkdy7KvhKFygqKCqC9T3quiox1pvZaDTLRRDPfzee7ojcyshulbcX...',NULL,'2025-06-13 11:34:46.010519',NULL,918,NULL,1973,'PUBLIC_RESPONSE'),(2287,'We are looking into your issue.',NULL,'2025-06-13 11:42:35.546329',NULL,995,NULL,1973,'PUBLIC_RESPONSE'),(2288,'Due Date changed from 2025-06-16T11:41:52.279670 to 2025-06-13T00:00',NULL,'2025-06-13 11:43:19.404446',NULL,563,563,1974,'PUBLIC_RESPONSE'),(2289,'Dear Sir,\nAs per the request by canon vendor, i have given all 3 printers usage count for the next cartridge refilling for kondapur branch. hence iam closing the ticket',NULL,'2025-06-13 11:43:23.884652',NULL,563,NULL,1974,'PUBLIC_RESPONSE'),(2290,'Status changed from OPEN to CLOSED',NULL,'2025-06-13 11:43:24.703928','CLOSED',563,563,1974,'PUBLIC_RESP